import React from 'react'
import Allbanner from './Allbanner';
import Nav from '../components/global-components/navbar-v3';
import { AllShop } from './AllShop';
const All = () => {
  return (
    <div>
        <Nav/>
        <Allbanner/>
        <AllShop/>

    </div>
  )
}

export default All
